import { Text,View,Image ,StyleSheet} from "react-native";
import { useLayoutEffect } from "react";


function Chatting({route,navigation}){

  
  useLayoutEffect(()=>{
    navigation.setOptions({
        headerLeft:()=>{
            return ( <View>
            <Image style={ChattingStlye.smallIamge} source={require("../../Image/pp.jpg")}/>
         </View>)
        }
    });
},[navigation]);


    return(
      <View>
          <Text>Chatting</Text>
      </View>
        

    )
}


export default Chatting;


const ChattingStlye=StyleSheet.create({
  smallIamge:{
    width:40,
        height:40,
        borderRadius:20,
        marginLeft:25
  }
})
